import React, { Component } from 'react';
import Letter from './Letter.js'


class Letters extends Component {

    renderLetters(){
        // let letterStatus = this.props.letterStatus
        // for (let i= 65; i < 91; i ++){
        //     this.render(letterStatus[String.fromCharCode(i)])
        // }
    }

    render() {
        let letterStatus = this.props.letterStatus
        for (let i= 65; i < 91; i ++){
            letter = letterStatus[String.fromCharCode(i)]
            return (
                <div>
                    <Letter letter={letter} key={letter}/>
                </div>
            );
        }

    }
}

export default Letters;
